<template>
  <div style="min-height: 100vh">
    <div class="hero-section">
      <div class="container">
        <swiper
          :pagination="{
            clickable: true,
          }"
          :effect="'fade'"
          :modules="[SwiperPagination, SwiperPagination]"
          class="mySwiper"
        >
          <swiper-slide
            v-for="i in 5"
            class="flex-column flex-xl-row flex-lg-row"
          >
            <div class="text">
              <h1 class="head">
                منصة تختص في بيع وشراء وتمويل <span> السيارات</span> بطرق حديثة
              </h1>
              <p>
                تكنولوجيا التمويل والبيع تلتقي هنا! استكشف عالم كود كار، حيث
                يمكنك بسهولة شراء سيارات أحلامك. انضم إلينا واستفد من أفضل
                العروض
              </p>
            </div>

            <div class="image">
              <img
                class="img-fluid"
                src="~/assets/images/hero-car.png"
                alt=""
              />
            </div>
          </swiper-slide>
        </swiper>
      </div>
    </div>

    <div class="container d-flex align-items-center justify-content-center">
      <div class="search-section">
        <div class="select">
          <span class="type"> النوع </span>
          <v-autocomplete
            chips
            :items="brandsArr.brands"
            item-title="name"
            item-value="id"
            variant="underlined"
            label="اختر نوع السيارة"
          ></v-autocomplete>
        </div>
        <div class="select">
          <span class="type"> الماركة </span>
          <v-autocomplete
            clearable
            chips
            :items="brandsArr.brands"
            
            item-title="name"
            item-value="id"
            variant="underlined"
            label="اختر ماركة السيارة"
          ></v-autocomplete>
        </div>
        <div class="select">
          <span class="type"> الفئة </span>
          <v-autocomplete
            chips
            :items="categArr"
            item-title="title"
            item-value="id"
            variant="underlined"
            label="اختر فئة السيارة"
          ></v-autocomplete>
        </div>
        <button class="search">ابحث</button>
      </div>
    </div>

    <div class="brands">
      <div
        class="text d-flex align-items-center justify-content-center text-center flex-column"
      >
        <h4 class="heading-text">الماركات</h4>
        <p class="p-text">
          استكشف تشكيلة متنوعة من أفضل الماركات العالمية لتلبية احتياجاتك
          المختلفة وتجربة القيادة بأسلوب فريد.
        </p>
        <!-- <p class="p-text " v-html="brandsArr.description">
        </p> -->
      </div>

      <div class="container">
        <div class="row">
          <div
            v-for="item in brandsArr.brands"
            class="col-6 col-xl-2 col-lg-2 col-md-3 my-4"
          >
            <div class="box">
              <div class="image" :style="{backgroundImage: 'url(' +( item.cover  ?  item.cover :'https://placehold.co/600'   ) + ')' }">
                <!-- <img src="~/assets/images/brand1.png" alt=""> -->
              </div>
              <span class="name"> {{ item.name }} </span>
              <span class="num"> {{ item.count_cars_count }} سيارة </span>
            </div>
          </div>
        </div>
      </div>
    </div>

